import React, { useState } from "react";
import styled from "styled-components";
import { useNavigate } from "react-router-dom";

const Container = styled.div`
  position: relative;

  overflow: auto;

  &::-webkit-scrollbar {
    display: none;
  }

  width: 1280px;
  height: 720px;

  border: 0.5px solid #000;
  background: #fff;
  margin: 0px auto;
`;

// 상단바
const Logo = styled.div`
  position: relative;

  width: 50px;
  margin-top: 60px;
  margin-left: 60px;
  z-index: 999;
`;
const MenuContainer = styled.div`
  position: relative;
  margin-top: -60px;
  margin-left: 490px;

  line-height: 1;
`;
const Menu = styled.div`
  position: relative;
  display: inline-block;

  margin-left: 90px;

  color: #000;
  text-align: center;
  font-family: Pretendard;
  font-size: 36px;
  font-style: normal;
  font-weight: 800;

  &.design {
    position: relative;
    border-bottom: 4px solid #000;
    padding-bottom: 4px;
  }

  &:hover {
    cursor: pointer;
    color: #ff6d2e;
    border-bottom-color: #ff6d2e;
  }
`;

// 내용
const ListContainer = styled.div`
  background: #00ff22;

  margin-top: 30px;
  padding: 20px;
`;

const WhiteBox = styled.div`
  width: 1130px;
  height: ${(props) => (props.expanded ? "343px" : "210px")};

  margin-left: 50px;
  margin-top: 38px;

  padding-top: 35px;

  border-radius: 30px;
  background: #fff;
  box-shadow: 2px 0px 10px 0px rgba(0, 0, 0, 0.54);
`;
const QuestBox = styled.div`
  height: 50px;

  padding-left: 52px;

  color: #000;
  font-family: Pretendard;
  font-size: 33px;
  font-style: normal;
  font-weight: 800;
  line-height: normal;
`;
const AnswerBox = styled.div`
  background: #ff0000;
  position: relative;

  width: 995px;
  height: ${(props) => (props.expanded ? "190px" : "53px")};

  margin-top: 13px;
  margin-left: 50px;

  padding-left: 30px;
  padding-top: 20px;

  border-radius: 20px;
  background: #fff;
  box-shadow: 0px 0px 10px 0px rgba(0, 0, 0, 0.25) inset;
`;
const InputAnswer = styled.input`
  width: 950px;
  height: ${(props) => (props.expanded ? "120px" : "40px")};
  border: none;

  color: #000;
  font-family: Pretendard;
  font-size: 20px;
  font-style: normal;
  font-weight: 500;
  line-height: normal;
`;
const NextBtn = styled.button`
  height: 60px;
  width: 90px;

  margin-left: 998px;
  margin-top: 0px;

  background-color: transparent;
  border: none;
`;
const List = () => {
  //
  const [isExpanded, setIsExpanded] = useState(false);

  const handleInputClick = () => {
    setIsExpanded(!isExpanded);
  };

  return (
    <WhiteBox expanded={isExpanded}>
      <QuestBox>Q. 키오스크 결제는 어떻게?</QuestBox>
      <AnswerBox expanded={isExpanded}>
        <InputAnswer
          onClick={handleInputClick}
          expanded={isExpanded}
        ></InputAnswer>
        <img
          src="./images_minwoo/addImg.png"
          style={{
            width: "70px",
            position: "absolute",
            bottom: "6px",
            right: "10px",
          }}
        />
      </AnswerBox>
      <NextBtn>
        <img src="./images_minwoo/next.png" style={{ width: "180px" }} />
      </NextBtn>
    </WhiteBox>
  );
};

//페이지 함수
const Answer = () => {
  const navigate = useNavigate();

  const GoMyPage = () => {
    navigate("/RespondMyPage");
  };

  const GoAnswer = () => {
    navigate("/Answer");
  };

  const GoLogout = () => {
    navigate("/");
  };

  return (
    <Container>
      <Logo>
        <img
          src={`${process.env.PUBLIC_URL}/images_semin/logo.png`}
          alt="logo"
          style={{ width: "150px" }}
        />
      </Logo>

      <MenuContainer>
        <Menu onClick={GoAnswer} className="design">
          답변하기
        </Menu>
        <Menu onClick={GoLogout}>로그아웃</Menu>
        <Menu onClick={GoMyPage}>나의 기록</Menu>
      </MenuContainer>

      <ListContainer>
        <List />
        <List />
        <List />
      </ListContainer>
    </Container>
  );
};

export default Answer;
